import React from 'react';
import EventList from '../components/EventList';

const EventListingPage = () => {
  // ... (existing code)

  const handleCreateEvent = async () => {
    try {
      const response = await fetch('http://localhost:3001/events', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          name: 'Dummy Event',
          date: '2024-01-22',  // Change this to a valid date
          location: 'Dummy Location',
          description: 'Dummy Description',
          organizer: 'Dummy Organizer',
        }),
      });

      if (response.ok) {
        console.log('Dummy Event created successfully!');
      } else {
        console.error('Error creating dummy event:', response.statusText);
      }
    } catch (error) {
      console.error('An error occurred while creating the dummy event:', error);
    }
  };

  return (
    <div>
      {/* ... (existing code) */}
      <a href="/create-event">
        <button onClick={handleCreateEvent}>Create Event</button>
      </a>
    </div>
  );
};

export default EventListingPage;
